import React from 'react';

const Stack = () => {
    const styles = {
        'text-align': 'center',
        'position': 'relative',
        'top': '50%',
        'left': '50%',
        'margin-right': '-50%',
        'transform': 'translate(-50%, -50%)',
        'color': 'white'
    }
    return(
        <>
            <h1 style={styles}>My Stack</h1>
            <h2 style={styles}>My technical stack</h2>
        </>
    )
}

export default Stack;
